import React, { useState, useEffect } from 'react';
import { createCommerce } from '../services/commerceService';

const CommerceForm = () => {
  const [formData, setFormData] = useState({
    RUC: '',
    NombreComercial: '',
    RazonSocial: '',
    Direccion: '',
    Telefono: '',
    NombreContacto: '',
    TipoEstablecimiento: 'Restaurante',
    ImagenLogotipo: null
  });

  const [validated, setValidated] = useState(false);

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: files ? files[0] : value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (e.currentTarget.checkValidity() === false) {
      e.stopPropagation();
    } else {
      try {
        const formDataToSend = new FormData();
        for (const key in formData) {
          formDataToSend.append(key, formData[key]);
        }
        await createCommerce(formDataToSend);
        alert('Commerce created successfully!');
      } catch (error) {
        console.error('Error creating commerce:', error);
        alert('Failed to create commerce');
      }
    }
    setValidated(true);
  };

  return (
    <div className="container mt-5">
      <h2>Registrar Comercio</h2>
      <form onSubmit={handleSubmit} className="needs-validation" noValidate>
        <div className="mb-3">
          <label htmlFor="RUC" className="form-label">RUC</label>
          <input type="text" name="RUC" id="RUC" value={formData.RUC} onChange={handleChange} className="form-control" placeholder="RUC" required />
          <div className="invalid-feedback">Por favor, ingrese el RUC.</div>
        </div>
        <div className="mb-3">
          <label htmlFor="NombreComercial" className="form-label">Nombre Comercial</label>
          <input type="text" name="NombreComercial" id="NombreComercial" value={formData.NombreComercial} onChange={handleChange} className="form-control" placeholder="Nombre Comercial" required />
          <div className="invalid-feedback">Por favor, ingrese el nombre comercial.</div>
        </div>
        <div className="mb-3">
          <label htmlFor="RazonSocial" className="form-label">Razón Social</label>
          <input type="text" name="RazonSocial" id="RazonSocial" value={formData.RazonSocial} onChange={handleChange} className="form-control" placeholder="Razón Social" required />
          <div className="invalid-feedback">Por favor, ingrese la razón social.</div>
        </div>
        <div className="mb-3">
          <label htmlFor="Direccion" className="form-label">Dirección</label>
          <input type="text" name="Direccion" id="Direccion" value={formData.Direccion} onChange={handleChange} className="form-control" placeholder="Dirección" required />
          <div className="invalid-feedback">Por favor, ingrese la dirección.</div>
        </div>
        <div className="mb-3">
          <label htmlFor="Telefono" className="form-label">Teléfono</label>
          <input type="text" name="Telefono" id="Telefono" value={formData.Telefono} onChange={handleChange} className="form-control" placeholder="Teléfono" required />
          <div className="invalid-feedback">Por favor, ingrese el teléfono.</div>
        </div>
        <div className="mb-3">
          <label htmlFor="NombreContacto" className="form-label">Nombre de Contacto</label>
          <input type="text" name="NombreContacto" id="NombreContacto" value={formData.NombreContacto} onChange={handleChange} className="form-control" placeholder="Nombre de Contacto" required />
          <div className="invalid-feedback">Por favor, ingrese el nombre de contacto.</div>
        </div>
        <div className="mb-3">
          <label htmlFor="TipoEstablecimiento" className="form-label">Tipo de Establecimiento</label>
          <select name="TipoEstablecimiento" id="TipoEstablecimiento" value={formData.TipoEstablecimiento} onChange={handleChange} className="form-select">
            <option value="Restaurante">Restaurante</option>
            <option value="Transporte">Transporte</option>
            <option value="Hotel">Hotel</option>
          </select>
        </div>
        <div className="mb-3">
          <label htmlFor="ImagenLogotipo" className="form-label">Imagen Logotipo</label>
          <input type="file" name="ImagenLogotipo" id="ImagenLogotipo" onChange={handleChange} className="form-control" />
        </div>
        <button type="submit" className="btn btn-primary">Crear Comercio</button>
      </form>
    </div>
  );
};

export default CommerceForm;
